import React from "react";
import "./searchpage.css";

function SeachPage() {
  return (
    <div className="searchpage">
      <div className="searchpage_info">
        <p>62 stays • 26 august to 30 august • 2 guest</p>
        <h1>Stays nearby</h1>
      </div>
    </div>
  );
}

export default SeachPage;
